import React from 'react';
import { Card, Collapse, Typography, Button, Tooltip } from 'antd'
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import { SaveOutlined } from '@ant-design/icons'

const { Title } = Typography
const { Panel } = Collapse

const useStyles = makeStyles(theme => ({
    root: {
        display: 'flex',
        flexWrap: 'wrap',
        flexGrow: 1
    },
    textField: {
        marginLeft: theme.spacing(1),
        marginRight: theme.spacing(1),
        width: '25ch',
    },
}));

export default function DialogFlow() {
    const classes = useStyles();

    return (
        <Card>
            <form className={classes.root} noValidate autoComplete="off">
                <Grid containter>
                    <Grid item xs={11}>
                        <TextField id="intent" label="Intent" variant="outlined" required style={{ width: '100%', fontSize: '2rem' }} />
                    </Grid>
                    <Grid item xs={1}>
                        <Button type="primary" icon={<SaveOutlined style={{ fontSize: '1.75rem' }} />} style={{ marginLeft: '10px', height: '100%', width: '100%' }} />
                    </Grid>
                </Grid>
                <Grid container>
                    <Collapse>

                    </Collapse>
                </Grid>
            </form>
        </Card>
    );
}
